import React from "react";
import github from "../../Assets/github.svg";
import linkedin from "../../Assets/linkedin.svg";
import email from "../../Assets/envelope-solid.svg";
import "./Icons.css";

// import { Row, Col } from "react-bootstrap";

export default function Icons() {
    return <div className=".icons-row ">
        <div className="icon"><img src={github} alt="github-icon"/></div>
        <div className="icon"><img src={linkedin} alt="linked-icon"/></div>
        <div className="icon"><img src={email} alt="email-icon"/></div>
    </div>
}
